              showscale: false
            }],
               {margin: {t: 0 } } 
              );
  
      timeRange_utilities = range(0.5, problem.periods + 1.5);
      Plotly.newPlot(document.getElementById('utilities'),[{
               x: timeRange_utilities,
               y: wealthValues,
               z: expectedUtilities,
               type: 'heatmap',
               showscale: false
             }],
                {margin: {t: 0 } } 
               );            
  
      function range (start, end) {
        return Array.from({ length: end - start + 1 }, (_, index) => start + index);
      }
    </script></body></html>
